function App() {
  return (
    <div className="home-background">
      <img className="fixed-top-left" src="./images/세모.png" alt="Top Left" />
      <img
        className="fixed-bottom-left"
        src="./images/작은동.png"
        alt="Bottom Left"
      />
      <img
        className="fixed-bottom-right"
        src="./images/큰동.png"
        alt="Bottom Right"
      />
    </div>
  );
}

export default App;
